REPLACE INTO `attraction` (`id`, `name`, `type`, `price`, `category`, `min_capacity`, `description`, `video_url`, `geom`, `geom_area`) VALUES
	('AT001', 'Atraksi Kesenian Tradisional', 'Culture', 1500000, 1, 20, 'Selain melestarikan nilai budaya berbentuk rumah gadang, masyarakat desa wisata kampung Minang nagari Sumpu juga masih melestarikan kesenian tradisional melalui sanggar Riak Sumpu, untuk itu wisatawan bisa menikmati penampilan kesenian seperti tari piring, tari gelombang ataupun penampilan randai, tentunya dengan memesan paket kesenian di desa wisata kampung Minang nagari Sumpu.', '', _binary 0x000000000106000000010000000103000000010000000500000074187613831f5940711dccebe1c4e0bf741836f7841f5940677f119cc8c4e0bf74181635851f5940ba005d8822c6e0bf74187613831f5940a46f004844c6e0bf74187613831f5940711dccebe1c4e0bf, _binary 0x000000000106000000010000000103000000010000000500000074187613831f5940711dccebe1c4e0bf741836f7841f5940677f119cc8c4e0bf74181635851f5940ba005d8822c6e0bf74187613831f5940a46f004844c6e0bf74187613831f5940711dccebe1c4e0bf),
	('AT002', 'Pertunjukan Silat Tradisional Sumpu', 'Culture', 275000, 1, 20, 'Silat tradisional Minangkabau adalah seni bela diri yang di miliki masyarakat Minangkabau pada umumnya, dikarenakan masyarakat Minang kabau memiliki kebiasaan hidup merantau, sehingga seni bela diri ini diwariskan turun temurun dari generasi ke generasi. Masyarakat Sumpu masih tetap melestarikan seni bela diri ini di kehidupan masyarakatnya, sehingga seni bela diri ini menjadi penampilan yang bisa di nikmati wisatawan kalau berwisata di desa ini.', '', _binary 0x000000000106000000010000000103000000010000000500000074187613831f5940711dccebe1c4e0bf741836f7841f5940677f119cc8c4e0bf74181635851f5940ba005d8822c6e0bf74187613831f5940a46f004844c6e0bf74187613831f5940711dccebe1c4e0bf, _binary 0x000000000106000000010000000103000000010000000600000074187613831f5940711dccebe1c4e0bf74187613831f5940a46f004844c6e0bf74181635851f5940ba005d8822c6e0bf741836f7841f5940677f119cc8c4e0bf74187613831f5940711dccebe1c4e0bf74187613831f5940711dccebe1c4e0bf),
	('AT003', 'Makan Bajamba', 'Culture', 300000, 1, 3, 'Di desa wisata Kampung Minang, tradisi makan bajamba ini merupakan salah satu paket unggulan yang kami tawarkan untuk wisatawan, dikarenakan sajian makan bajamba di desa ini menjadi menarik karna di sajikan di atas rumah gadang dengan sajian kuliner khas nagari Sumpu, dan di tambah dengan iringan lantunan saluang/ bansi(seruling khas Minangkabau)) secara Live.', '', _binary 0x00000000010600000001000000010300000001000000050000002550262f811f5940465f42d58bc6e0bf25502678831f5940a9ce878572c6e0bf255086cc831f59403eef292067c8e0bf2550265c811f59408fb6dc3f83c8e0bf2550262f811f5940465f42d58bc6e0bf, _binary 0x00000000010600000001000000010300000001000000060000002550262f811f5940465f42d58bc6e0bf2550265c811f59408fb6dc3f83c8e0bf255086cc831f59403eef292067c8e0bf25502678831f5940a9ce878572c6e0bf2550262f811f5940465f42d58bc6e0bf2550262f811f5940465f42d58bc6e0bf),
	('AT004', 'Atraksi Manjalo Di Ateh Biduak', 'Culture', 325000, 1, 10, 'Danau Singkarak merupakan danau yang memiliki ikan endemi yaitu Ikan Bilih, ikan ini hanya bisa ditemui di danau Singkarak. Cara penangkapan ikan ini terkadang ada bermacam-macam di seputar danau, namun di nagari Sumpu system penangkapannya masih dengan cara yang tradisional yang tidak merusak kelestarian ikan Bilih. Salah satu cara penangkapannya adalah dengan memaki jala dengan ukuran besar yang di lempar dari sebuah sampan kecil yang biasa di sebut masyarakat dengan sebutan Biduak. Menjala di atas biduak ini hanya bisa dilakukan dengan sempurna oleh nelayan-nelayan profesional yang Cuma ada di desa ini. Selain teori menebar jala yang menjadi spesial, cara nelayan menentukan tanda-tanda titik kumpul ikan di danau pun juga menjadi hal menarik untuk di bicarakan dengan nelayan, karna tidak semua lokasi danau bakal di tebar jala akan mendapatkan ikan.', '', _binary 0x0000000001060000000100000001030000000100000007000000f567827e831f59409e08635e6d31e1bff56702cd871f5940cbf1c09da531e1bff56702ae881f59407d6da24c9437e1bff5678224831f59409eddbe0be337e1bff567020e831f5940d9193852a535e1bff567023b831f59401872a8961b34e1bff567827e831f59409e08635e6d31e1bf, _binary ),
	('AT005', 'Naik Sampan Tradisional', 'Adventure', 25000, 2, 1, 'Tepian danau Singkarak merupakan salah satu daya tarik untuk di kunjungi wisatawan di desa wisata kampung Minang nagari Sumpu, selain pemandangan danau Singkarak dan atraksi nelayan menjala ikan dari atas sampan, wisatawan juga bisa merasakan langsung naik sampan tradisional nelayan.', '', _binary 0x00000000010600000001000000010300000001000000070000004d5296e6151f594007b0259fdf5ae1bf4d523638151f594018d5ebaca15be1bf4d52568f161f59400fbfebdbf85be1bf4d5256f7171f5940d3feb1a0585ae1bf4d52f6a2171f594016c8ebf0445ae1bf4d5236fa161f5940d7d2a9ce095be1bf4d5296e6151f594007b0259fdf5ae1bf, _binary ),
	('AT006', 'Edukasi Memasak', 'Education', 600000, 1, 10, 'Kuliner Khas Nagari Sumpu merupakan salah satu daya Tarik utama untuk wisatawan nikmati di desa wisata ini, sehingga kuliner khas ini merupakan salah satu faktor desa wisata Kampung Minang Nagari Sumpu meraih penghargaan ke 4 di kategori suvenir di ajang Anugerah Desa Wisata Indonesia tahun 2021. Selain menikmati kuliner khas, wisatawan juga bisa merasakan bagaimana cara memasak masakan khas ini melalui edukasi memasak, seperti belajar masak masakan Rendang Sumpu, Pangek sumpu ataupun Singgang Sumpu.', '', _binary 0x00000000010600000001000000010300000001000000050000002adc6340801f5940c5342dbd66c2e0bf2adc633d831f5940f5b306cd74c2e0bf2adce326831f5940d86dbc96c0c4e0bf2adc23db7f1f594007793fc790c4e0bf2adc6340801f5940c5342dbd66c2e0bf, _binary 0x00000000010600000001000000010300000001000000060000002adc6340801f5940c5342dbd66c2e0bf2adc23db7f1f594007793fc790c4e0bf2adce326831f5940d86dbc96c0c4e0bf2adc633d831f5940f5b306cd74c2e0bf2adc6340801f5940c5342dbd66c2e0bf2adc6340801f5940c5342dbd66c2e0bf),
	('AT007', 'Tracking', 'Adventure', 35000, 1, 10, 'Nagari Sumpu merupakan sebuah nagari atau desa yang terletak di Kawasan kaki bukit, sehingga bisa menjadi salah satu pilihan untuk wisatawan yang hobi tracking. Puncak tubia salah satu tempat yang menjadi tujuan tracking, puncak ini adalah salah satu tempat bersejarah bagi masyarakat Sumpu dikarenakan menjadi tempat Perumahan awal asal muasal masyarakat Sumpu. Dari puncak ini, wisatawan dapat menikmati pemandangan danau Singkarak dan pemandangan desa yang memiliki hamparan sawah yang luas. Selain perjalanan ke puncak tubia, wisatawan juga bisa melakukan perjalanan dengan sepeda di dalam desa.', '', _binary 0x000000000106000000010000000103000000010000000700000099015cef5b1f5940d01291bdb0b4e0bf9901dc325c1f59407417c33e40b4e0bf99015c575d1f5940ed7da47e4bb4e0bf99015c845d1f594071a616bdddb4e0bf9901dce65c1f59406c8be43b4eb5e0bf99015cef5b1f59406c8be43b4eb5e0bf99015cef5b1f5940d01291bdb0b4e0bf, _binary ),
	('AT008', 'Manjalo Bilih Di Muaro', 'Culture', 200000, 1, 10, 'Menangkap ikan Bilih tidak hanya di lakukan di Kawasan danau Singkarak, namun juga di dilakukan nelayan di Kawasan muara sungai batang Sumpu. Menjala ikan di Kawasan ini di lakukan nelayan tidak dengan memakai sampan, namun di lempar dari daratan dan aliran air yang cukup dangkal, sehingga wisatawan bisa ikut mencoba cara menjala ikan Bilih ini. Cara penangkapan ikan bilih di Kawasan ini juga menjadi sesuatu yang menarik untuk diketahui, dikarenakan aturan-aturan penangkapan di Kawasan ini yang memiliki aturan yang sudah turun temurun dari nenek moyang masyarakat Sumpu.', '', _binary 0x00000000010600000001000000010300000001000000060000004a1783c7841f5940c53dfc8edb2ce1bf4a17c383881f59409fe4dbcee62ce1bf4a17c375871f5940b2449000de31e1bf4a1703d0831f5940b90e80a0e331e1bf4a174308841f594094403cc49730e1bf4a1783c7841f5940c53dfc8edb2ce1bf, _binary 0x00000000010600000001000000010300000001000000070000004a1783c7841f5940c53dfc8edb2ce1bf4a174308841f594094403cc49730e1bf4a1703d0831f5940b90e80a0e331e1bf4a17c375871f5940b2449000de31e1bf4a17c383881f59409fe4dbcee62ce1bf4a1783c7841f5940c53dfc8edb2ce1bf4a1783c7841f5940c53dfc8edb2ce1bf),
	('AT009', 'Edukasi Bertani', 'Education', 250000, 1, 10, 'Pertanian merupakan sumber ekonomi utama di desa ini, hamparan sawah Baruah dan sawah bukik merupakan lahan utama petani untuk bertanam padi. Momen masyarakat memulai menanam padi ataupun momen di saat panen raya adalah saat yang tepat bagi wisatawan untuk bisa ikut merasakan paket wisata ini, terutama buat wisatawan edukasi dari sekolah-sekolah.', '', _binary , _binary ),
	('AT010', 'Mengukir', 'Education', 125000, 1, 10, 'Rumah gadang sangat terkenal dengan daya tarik ukirannya, sehingga ukiran mengukir ukiran ini merupakan hal yang sangat menarik untuk di coba di desa wisata ini. Paket Mengukir ini merupakan paket yang biasa di ambil oleh wisatawan-wisatawan edukasi dari sekolah-sekolah.', '', _binary , _binary ),
	('AT011', 'Manyulam', 'Education', 125000, 1, 10, 'Sulaman merupakan daya tarik suvenir yang ada di tiap daerah wisata, begitu juga di desa wisata kampung Minang nagari Sumpu. Sulaman salendang bajaik kapalo samek merupakan salah satu sulaman yang di buat oleh masyarakat desa Sumpu, selendang ini merupakan selendang pakaian menantu perempuan di desa ini yang di pakai di acara-acara adat.', '', _binary 0x0000000001060000000100000001030000000100000005000000cab2e573e51f5940da83872992e5e0bfcab265f2e61f594059781eebffe4e0bfcab245f5e51f5940a9e6f32c57e4e0bfcab22571e41f59403af2357bf7e4e0bfcab2e573e51f5940da83872992e5e0bf, _binary 0x0000000001060000000100000001030000000100000006000000cab2e573e51f5940da83872992e5e0bfcab265f2e61f594059781eebffe4e0bfcab245f5e51f5940a9e6f32c57e4e0bfcab22571e41f59403af2357bf7e4e0bfcab2e573e51f5940da83872992e5e0bfcab2e573e51f5940da83872992e5e0bf),
	('AT012', 'Tubing Dan Arum Jeram', 'Adventure', 85000, 2, 1, 'Desa Wisata Kampung Minang Nagari Sumpu tidak hanya menyajikan wisata budaya saja, namun desa ini juga memiliki alam yang indah, salah satunya adanya aliran sungai yang mengalir di dalam Kawasan desa yang bermuara di danau Singkarak. Sarana batang Sumpu di manfaatkan untuk sarana bagi wisatawan pencinta outbond berupa river tubing atau rafting.', '', _binary 0x0000000001060000000100000001030000000100000005000000e727f9c5331f5940fd7cf21b8ce0e0bfe727394a331f5940beaf727ea5dfe0bfe727b941341f5940d192ef7e78dfe0bfe72779ea341f594043cf5fbc64e0e0bfe727f9c5331f5940fd7cf21b8ce0e0bf, _binary 0x0000000001060000000100000001030000000100000006000000e727f9c5331f5940fd7cf21b8ce0e0bfe72779ea341f594043cf5fbc64e0e0bfe727b941341f5940d192ef7e78dfe0bfe727394a331f5940beaf727ea5dfe0bfe727f9c5331f5940fd7cf21b8ce0e0bfe727f9c5331f5940fd7cf21b8ce0e0bf),
	('AT013', 'Tur Batu Bajanjang', 'Culture', 100000, 1, 10, 'Batu Bajanjang adalah pintu masuk dari kerajaan Samaskuta yang turun ke dalam danau dan di tengah danau tangga tersebut menonjol ke atas dan turun lagi kira-kira 1 km dan naik lagi sampai ke pantai seberang Jorong Sudut Sumpur. Kota Samaskuta adalah Sebuah kerajaan yang ada di pedalaman Sumatera dan tepatnya di Danau Singkarak', '', _binary , _binary ),
	('AT014', 'Kunjungan Makam Abdul Hamid Hakim', 'Culture', 50000, 1, 10, 'Syekh Haji Abdul Hamid Hakim adalah seorang ulama terkemuka Indonesia asal Minangkabau yang merupakan pengarang kitab Mabadi Awwaliyah', '', _binary , _binary ),
	('AT015', 'Tur Rumah Belanda Siti Kayo', 'Culture', 125000, 1, 10, 'Rumah berarsitektur Belanda yang dimiliki oleh Siti Kayo memiliki struktur yang dibangun dari kayu-kayu Kalimantan dan berisi peninggalan barang-barang antik', '', _binary 0x0000000001060000000100000001030000000100000005000000de6cdb832c1f5940b0e0127983e2e0bfde6c3b4e2f1f59408ea54798cce2e0bfde6c5b102f1f59404641fd859fe3e0bfde6c9b1e2c1f5940b31ab1d65ee3e0bfde6cdb832c1f5940b0e0127983e2e0bf, _binary 0x0000000001060000000100000001030000000100000006000000de6cdb832c1f5940b0e0127983e2e0bfde6c9b1e2c1f5940b31ab1d65ee3e0bfde6c5b102f1f59404641fd859fe3e0bfde6c3b4e2f1f59408ea54798cce2e0bfde6cdb832c1f5940b0e0127983e2e0bfde6cdb832c1f5940b0e0127983e2e0bf),
	('AT016', 'Atraksi Air Mendidih', 'Nature', 50000, 1, 10, 'Air yang selalu terlihat mendidih padahal suhu air yang mengalir normal', '', _binary 0x00000000010600000001000000010300000001000000050000007c8c46bcc81f5940ae10fd5776ebe0bf7c8c66f4ca1f59401cf2ca06e4ebe0bf7c8ca6a5ca1f59403be8bc74a0ece0bf7c8c86e6c71f59403521efc532ece0bf7c8c46bcc81f5940ae10fd5776ebe0bf, _binary 0x00000000010600000001000000010300000001000000060000007c8c46bcc81f5940ae10fd5776ebe0bf7c8c86e6c71f59403521efc532ece0bf7c8ca6a5ca1f59403be8bc74a0ece0bf7c8c66f4ca1f59401cf2ca06e4ebe0bf7c8c46bcc81f5940ae10fd5776ebe0bf7c8c46bcc81f5940ae10fd5776ebe0bf),
	('AT017', 'Tur Rumah Belanda Bahar Munaf', 'Culture', 85000, 1, 10, 'Rumah berarsitektur Belanda milik keluarga Bahar Munaf yang memiliki struktur batu garam dan berisi peninggalan barang-barang antik dan kuno', '', _binary , _binary ),
	('AT018', 'Panorama Puncak Tubia', 'Nature', 20000, 1, 10, '', '', _binary , NULL),
	('AT019', 'Air Terjun Titi Sarasah', 'Nature', 25000, 1, 10, '', '', _binary , NULL),
