	('SUM01', 'Kampuang Minang Nagari Sumpu', 'Culture and Ecotourism', 'Nagari Sumpu, Batipuh Selatan, Kabupaten Tanah Datar, Sumatera Barat', 'jeonaudy06@gmail.com', 'P03', '08:30:00', '18:30:00', 5000, '081374519594', 'Kampuang Minang Nagari Sumpu  terletak di Nagari Sumpur, Kecamatan Batipuh Selatan Kabupaten Tanah Datar Sumatra Barat tepatnya di sebelah utara Danau Singkarak yang di aliri oleh aliran Batang Sumpu. Untuk menuju ke Kampuang Minang Nagari Sumpu diperkirakan menempuh perjalanan dari Bandara Internasional Minangkabau lebih kurang 2 jam perjalanan. Di kampuang Minang Nagari Sumpu terdapat wisata yang berbasis budaya dengan adanya lebih kurang 70 buah rumah gadang dan beberapa situs sejarah. Dari sekian banyaknya rumah gadang, terdapat 3 buah rumah gadang yang sudah dijadikan  Homestay bagi wisatawan yang berkunjung ke Kampuang Minang Nagari Sumpu.', _binary , -0.52210813, 100.49432448, 'Bank Syariah Indonesia', '451', 'Desa Wisata Sumpu', '345234524', 'qr_bni.jpg');
